// import logo from '../logo.svg';
import './App.css';
import { ColorfulLink } from './ColorfulLink.js';
import React from 'react';
import {View, Image, StyleSheet} from 'react-native';
import { Parallax, ParallaxBanner } from 'react-scroll-parallax';

function App() {


  // const handleScrollTo = () => {
  //   console.log("scrolled");
  // };

  // React.useEffect(() => {
  //   if (props.offset) {
  //     window.addEventListener("scroll", handleScrollTo);
  //   }
  //   return function cleanup() {
  //     if (props.offset) {
  //       window.removeEventListener("scroll", handleScrollTo);
  //     }
  //   };
  // });

  return (
    <div className="grid grid-rows-[20px_1fr_20px] items-center justify-items-center min-h-screen p-8 pb-20 gap-16 sm:p-20 font-[family-name:var(--font-geist-sans)]">

        <main className="flex flex-col gap-8 row-start-2 items-center sm:items-start">

          <div className="grid grid-cols-1 m-auto w-full justify-center fixed">
            <h1 className="text-xl text-center m-7 font-[family-name:var(--font-geist-mono)]">
                Cindy Qian
            </h1>

            <p className="text-sm text-left text-center font-[family-name:var(--font-geist-mono)] px-100 lowercase">

              Hello, I'm Cindy! I’m passionate about building products and experiences that empower people
              to express themselves in creative and meaningful ways. My creative soul thrives
              when I’m helping others bring their ideas to life!

              <br></br><br></br>

              I’ve had the chance to work on a range of exciting projects---from designing a custom
              point of sale system for
              <ColorfulLink link="https://ischool.uw.edu/capstone/projects/2024/grand-pere-wholesale-bakery-order-management-system" text=" Grand Père Bakery "></ColorfulLink>
              and
              <ColorfulLink link="https://www.yelp.com/biz/yeh-yehs-lynnwood-2?start=120" text=" Yeh Yeh's "></ColorfulLink>
              to developing an IoT mobile app for tracking construction machinery data for consulting company
              <ColorfulLink link="https://breadware.com" text=" Breadware "></ColorfulLink>
              to implementing new information systems for the parts operations team at
              <ColorfulLink link="https://www.genielift.com" text=" Genie"></ColorfulLink>
              . I also used to be a 
              <ColorfulLink link="https://mlh.io/coaches" text=" hackathon coach "></ColorfulLink>
              at
              <ColorfulLink link="https://mlh.io" text=" Major League Hacking"></ColorfulLink>
              ! On the side, I love running my own 
              <ColorfulLink link="https://www.instagram.com/bycindyq/" text=" small photography business"></ColorfulLink>
              ,
              <ColorfulLink link="https://dubhacks.co" text=" organizing hackathons"></ColorfulLink>
              , and
              <ColorfulLink link="https://www.instagram.com/cindyqiann/" text=" creating content"></ColorfulLink>
              . I also find a lot of joy in playing pokemon go (I started in 2023 & am at lv. 41, add me 5772 7964 6941), 
              <ColorfulLink link="https://www.instagram.com/wafflehour_/" text=" bouldering"></ColorfulLink>
              , and taking walks.
              <br></br><br></br>

              While I’m still figuring out the path that fits me best, I’m seeking opportunities
              that will let me hone my skills, collaborate with inspiring teams, and keep
              learning along the way.

              <br></br><br></br>

              Welcome! Take a look around :)
            </p>
          </div>

          {/* <div className="grid grid-cols-1 gap-4">
            <ParallaxBanner
              layers={[
                { image: '../images/shoreline.png', speed: -20 },
                { image: '../images/shoreline.png', speed: -10 },
              ]}
              className="aspect-[2/1]"
            >
                <h1 className="text-8xl text-white font-thin">Hello World!</h1>
            </ParallaxBanner>
          </div> */}

          <Parallax speed={50}>
            <div className="table w-full">
              <div className="table-row">
                <div className="table-cell">
                  <img className="w-40 m-10"
                  src={require("../images/selfiecindy.png")}
                  alt="Picture of Cindy Qian" />
                </div>
                <div className="table-cell">
                  <img className="w-40 m-10"
                  src={require("../images/squatwaterfallcindy.png")}
                  alt="Picture of Cindy Qian" />
                </div>
                <div className="table-cell">
                  <img className="w-40 m-10"
                  src={require("../images/gradcindy.png")}
                  alt="Picture of Cindy Qian" />
                </div>
                <div className="table-cell">
                  <img className="w-40 m-10"
                  src={require("../images/lassenselfie.png")}
                  alt="Picture of Cindy Qian" />
                </div>
                <div className="table-cell">
                  <img className="w-40 m-10"
                  src={require("../images/pogo.png")}
                  alt="Picture of Cindy Qian" />
                </div>
              </div>


              <div className="table-row">
                <div className="table-cell">
                  <img className="w-1/2 m-10"
                  src={require("../images/tt3.png")}
                  alt="Picture of Cindy Qian" />
                </div>
                <div className="table-cell">
                  <img className="w-40 m-10"
                  src={require("../images/dhlogs2.png")}
                  alt="Picture of Cindy Qian" />
                </div>
                <div className="table-cell">
                  <img className="w-40 m-10"
                  src={require("../images/gradcindy.png")}
                  alt="Picture of Cindy Qian" />
                </div>
                <div className="table-cell">
                  <img className="w-40 m-10"
                  src={require("../images/lassenselfie.png")}
                  alt="Picture of Cindy Qian" />
                </div>
                <div className="table-cell">
                  <img className="w-40 m-10"
                  src={require("../images/pogo.png")}
                  alt="Picture of Cindy Qian" />
                </div>
              </div>


            </div>
          </Parallax>








{/* 

          <Parallax speed={50}>
            <div className="grid grid-cols-4 gap-4">
              <div>
                <img className="object-cover object-center w-40 max-w-md rounded-lg m-10"
                  src={require("../images/selfiecindy.png")}
                  alt="Picture of Cindy Qian" />
              </div>

              <div>
                <img className="object-cover object-center w-40 max-w-md rounded-lg m-10"
                  src={require("../images/squatwaterfallcindy.png")}
                  alt="Picture of Cindy Qian" />
              </div>

              <div>
                <img className="object-cover object-center w-full max-h-80 max-w-md rounded-lg"
                  src={require("../images/shoreline.png")}
                  alt="Picture of Cindy Qian" />
              </div>

              <div>
                <img className="object-cover object-center w-full max-h-80 max-w-md rounded-lg"
                  src={require("../images/shoreline.png")}
                  alt="Picture of Cindy Qian" />
              </div>
            </div>


          </Parallax> */}

        </main>

        <footer className="row-start-3 flex gap-6 flex-wrap items-center justify-center">
        </footer>
      </div>
  );
}

export default App;
